import React from "react";
import {
  StyledContainer,
  PageTitle,
  PageLogo,
  InnerContainer,
} from "./../Components/Styles";
import { StatusBar } from "expo-status-bar";

const Login = () => {
  return (
    <>
      <StyledContainer>
          <StatusBar>
          </StatusBar>
        <InnerContainer>
        <center>
        <PageLogo
            
            source={require("../../asset/chat.jpg")}
            alt="Studethandelr"
          />
          </center>
          <PageTitle>Students</PageTitle>
  
        </InnerContainer>
      </StyledContainer>
    </>
  );
};
export default Login;
